import React from "react";
import "../styles/Footer.css";

//Importation du Footer.

function Footer() {
  return (
    <div className="footer">
      <div className="socialMedia"></div>
      <p> &copy; 2023 Boudreau Alexandre Projet Final</p>
    </div>
  );
}

export default Footer;
